import './App.css';
import * as React from 'react';

const movies = [
  {
    title: 'Movie One',
    type: 'movie',
    episodes: 1,
    currentEp: 0,
  },
  {
    title: 'Series One',
    type: 'series',
    episodes: 13,
    currentEp: 1,
  },
];

const List = ({ list }) => {
  <ul>
    {list.map((item) => {
      <li>{item.title}</li>
    })}
  </ul>
};

const App = () => {


  return (
    <>
      <List list={movies}></List>
    </>
  );
};

export default App;
